import React from "react";

const Root = () => {
    return (
        <div className="w-screen h-screen">
            <div className="flex space-x-8 w-full h-32 px-10 py-4">
                <p className="text-lg">VKV RESTAURATIES</p>
                <div className="flex flex-col text-xs py-1">
                    <p>PROJECTEN</p>
                    <p>OVER ONS</p>
                    <p>CONTACT</p>
                    <p>KAART</p>
                </div>
            </div>
        </div>
    );
}

export default Root;
